import React from 'react';
import Header from "../header/header";
import About from "../../pages/about";
import Switch from "@material-ui/core/Switch";
import Route from "react-router-dom/es/Route";

const App = () => {
    return (
        <div>
            <Header/>
            <Switch>
                <Route exact path="/about">
                    <About/>
                </Route>


            </Switch>
        </div>
    );
};

export default App;
